nuances\" that life reserves for you, all the emotions...Joy, gratitude, compassion, but also sadness, anger, pain...All that makes you human is to live these emotions, assimilate them and face both, good and bad moments.\nThe important thing is not to get overwhelmed by them.. Because letting yourself be overwhelmed by good emotions takes away your rationality and lucidity, letting yourself be overwhelmed by bad ones pushes you into a dark and colorless abyss, in which it's not worth sinking into.. What's your choice? \u2764\ud83e\udde1\ud83d\udc9b\ud83d\udc9a\ud83d\udc99\ud83d\udc9c\ud83d\udda4\n#life #motivation #colors #blackandwhite"}}]},"shortcode":"B9xQF8jqybX","edge_media_to_comment":{"count":0},"taken_at_timestamp":1584308082,"dimensions":{"height":1080,"width":1080},"display_url":"https://scontent-sjc3-1.cdninstagram.com/v/t51.2885-15/e35/89598974_525501998379530_9015277388582925663_n.jpg?_nc_ht=scontent-sjc3-1.cdninstagram.com\u0026_nc_cat=102\u0026_nc_ohc=Fm5mWe7X-YwAX-TxFNm\u0026oh=537796786f0b2cb77425bb2c6f431dfa\u0026oe=5E9F7F62","edge_liked_by":{"count":0},"edge_media_preview_like":{"count":0},"owner":{"id":"3216091604"},"thumbnail_src":"https://scontent-sjc3-1.cdninstagram.com/v/t51.2885-15/sh0.08/e35/s640x640/89598974_525501998379530_9015277388582925663_n.jpg?_nc_ht=scontent-sjc3-1.cdninstagram.com\u0026_nc_cat=102\u0026_nc_ohc=Fm5mWe7X-YwAX-TxFNm\u0026oh=3c477716d511c96c7ee1637aa04fa7fe\u0026oe=5E9C5E87","thumbnail_resources":[{"src":"https://scontent-sjc3-1.cdninstagram.com/v/t51.2885-15/e35/s150x150/89598974_525501998379530_9015277388582925663_n.jpg?_nc_ht=scontent-sjc3-1.cdninstagram.com\u0026_nc_cat=102\u0026_nc_ohc=Fm5mWe7X-YwAX-TxFNm\u0026oh=1a4fc3c3d6976667e1fc4df6ad525301\u0026oe=5E9A9620","config_width":150,"config_height":150},{"src":"https://scontent-sjc3-1.cdninstagram.com/v/t51.2885-15/e35/s240x240/89598974_525501998379530_9015277388582925663_n.jpg?_nc_ht=scontent-sjc3-1.cdninstagram.com\u0026_nc_cat=102\u0026_nc_ohc=Fm5mWe7X-YwAX-TxF ue no me viste, pude apreciar en medio de las multitudes, como tu cabeza se mov\u00eda al ritmo de una canci\u00f3n que desconoc\u00eda pero quer\u00eda o\u00edr.\nPorque tu me contagiabas de esa emoci\u00f3n, tan  pura en un mundo tan ruin\nFue un momento fugaz en el que vislumbre tu interior sin que lo supieras. Y que nunca llegar\u00edas a saber que con solo una sonrisa, llegaste al fondo de un lugar al que nunca nadie hab\u00eda llegado, ni llegara jam\u00e1s.\nPorque en medio del caos y el desenfreno se que tu le pusiste un orden a mi universo  para llev\u00e1rtelo con esa \u00faltima mirada.\nQue te robe y no permit\u00ed que me arrebataras... #vida #moments #ladrona #life #thoughts #caos #estupor #ritmoyluz"}}]},"shortcode":"B9xP3NfpBoQ","edge_media_to_comment":{"count":0},"taken_at_timestamp":1584307961,"dimensions":{"height":1080,"width":1080},"display_url":"https://scontent-sjc3-1.cdninstagram.com/v/t51.2885-15/e35/90214162_576752289595641_4464077202282469887_n.jpg?_nc_ht=scontent-sjc3-1.cdninstagram.com\u0026_nc_cat=109\u0026_nc_ohc=_kzG-rv3TIkAX_VY-Mo\u0026oh=9dc5a47f2fb4c18c20282af9443a3e60\u0026oe=5EA5E1D0","edge_liked_by":{"count":0},"edge_media_preview_like":{"count":0},"owner":{"id":"8522750138"},"thumbnail_src":"https://scontent-sjc3-1.cdninstagram.com/v/t51.2885-15/sh0.08/e35/s640x640/90214162_576752289595641_4464077202282469887_n.jpg?_nc_ht=scontent-sjc3-1.cdninstagram.com\u0026_nc_cat=109\u0026_nc_ohc=_kzG-rv3TIkAX_VY-Mo\u0026oh=f2767654d2d1490d2b14e9ef85ce1465\u0026oe=5E9CA635","thumbnail_resources":[{"src":"https://scontent-sjc3-1.cdninstagram.com/v/t51.2885-15/e35/s150x150/90214162_576752289595641_4464077202282469887_n.jpg?_nc_ht=scontent-sjc3-1.cdninstagram.com\u0026_nc_cat=109\u0026_nc_ohc=_kzG-rv3TIkAX_VY-Mo\u0026oh=be328eb78213a67a6c1ef028c39479c0\u0026oe=5E9B8A92","config_width":150,"config_height":150},{"src":"https://scontent-sjc3-1.cdninstagram.com/v/t51.2885-15/e35/s240x240/90214162_576752289595641_4464077202282469887_n.jpg?_nc_ht=sc
